qa-select-scroll-test(node: class benchmark-test)
  {initializations}
 x-pos-msg1: integer = 600;
 y-pos-msg1: integer = 500;
 x-pos-msg2: integer = 600;
 y-pos-msg2: integer = 550;

    {This procedure is used to test selection of messages within scroll-areas}
begin
    call g2-player-reset();

    {show ws and click on first message}
      call do-actions-on-ws(the symbol message-test);
     call click-at(x-pos-msg1,y-pos-msg1);
    {select message}
    call do-selections-from-menus("select","","","");

   {select another message}
    call do-actions-on-ws(the symbol message-test);
     call click-at(x-pos-msg2,y-pos-msg2);
    call do-selections-from-menus("select","","","");

     call pass(node);
end

qa-cascade-guide-dialogs-test(node: class benchmark-test)

  {This procedure tests out cascading uil-dialogs using player}

begin
  {reset player}
    call g2-player-reset();

  {show dialog workspace}
     call do-actions-on-ws(the symbol dialog);

  {select start button to launch dialogs}
    call click-action-button("start");

  {show next-dialog workspace and launch its dialog}
     call do-actions-on-ws(the symbol next-dialog);
    call click-action-button("start");

  {hide both workspaces}
     hide dialog;  hide next-dialog;

    {set debug flag}
        if qa-debug then begin
         wait for 4 seconds;
         inform the operator that "done launching dialogs";
        end;

     call pass(node);
end

do-actions-on-ws (ws_name: symbol)

{This procedure opens a desired workspace}

begin
    show the kb-workspace named by ws_name at the center of the screen;
end

qa-guide-fill-scroll-test(node: class benchmark-test)
  {initializations}
    filesys: symbol;
    filename: text;
     text-file-stream: class g2-stream;
    each-line: text;
     all-lines: text = "";
    counter: integer = 1;
    wksp: class kb-workspace = this workspace;
  {set scroll area and message object}
     sa: class uil-scroll-area;
    msg: class uil-message-object;

 {This procedure tests out filling uil-scrolls using a specified text file}

begin
    filesys = call g2-type-of-file-system ();
    if filesys = the symbol unix then filename = "/g2/src/tests/qa-guide-fill-scroll-test-data.txt"
    else filename = "c:\tmp\qa-guide-fill-scroll-test-data.txt";
    change the background-color of this workspace to cadet-blue;
      show this workspace at the center of the screen;
  {make the scroll area}
     sa = call uil-create-scroll-area("document-scroll",150,250);

  {prioritize messages}
    change the text of the ordering-method of sa to "priority";

  {open g2-stream}
    text-file-stream = call g2-open-file-for-read(filename);

    repeat  
  {exit if eof}
      exit if the g2-stream-status of text-file-stream = the symbol end-of-file-reached;

  {read each line of text file}
    each-line = call g2-read-line(text-file-stream);
      sa = call uil-get-grobj-from-id("document-scroll");

  {make messages with the text file}
     msg,sa = call uil-create-message(sa,"[each-line]",counter);
      allow other processing;
  {increment counter}
      counter = counter + 1;
    end;  {repeat}
inform the operator that "hello world";

    call uil-manage-grobj(sa,wksp,the symbol none,0,0);

  {close g2-stream}
     call g2-close-file(text-file-stream);

    {set debug flag}
        if qa-debug then
         wait for 4 seconds;
     call pass(node);
end
